import {FC, useEffect} from "react";
import {getAllProducts} from "../../server";
import {ProductCard} from "../../ui";
import {useDispatch, useSelector, connect} from "react-redux";
import {IProduct} from "../../type";






const Transport = (products:any) => {


    const dispatch = useDispatch()

    useEffect(()=>{
getAllProducts()
    .then((res) => {
dispatch({type:'GET_PRODUCTS', payload:res?.products}, )
    });
    }, [])

const {items} = products




    return(
        <div className='batman-store__container'>
            {items?.map((item:IProduct) => (
            <ProductCard {...item}/>
            ))}

        </div>
    )

}



const mapStateToProps = ({ products }:any) => products;


export default connect(mapStateToProps)(Transport);
